for dir in "${directories[@]}"; do
  # Count the number of .tcl files in the directory
  tcl_count=$(find "$dir" -maxdepth 1 -type f -name "*tcl" | wc -l)
 
  if [ "$tcl_count" -eq 2 ]; then
    echo "Directory with two .tcl files: $dir"
  fi
done
for dir in "${directories[@]}"; do
  # Count the number of .tcl files in the directory
  tcl_count=$(find "$dir" -maxdepth 1 -type d -name "altos*.ldb.gz" | wc -l)
 
  if [ "$tcl_count" -eq 2 ]; then
    echo "Directory with two .ldb.gz files: $dir"
  fi
done
 
 
